INSERT INTO `ps_product_lang` VALUES (21,1,1,'<div class=\"tabs\">\n<h3>Opis</h3>\n<div class=\"product-description\"><p><span>Wombaty to torbacze zamieszkujące Australię.</span></p>\n<p>Figurki malowane są ręcznie z dbałością o szczegóły, poszczególne egzemplarze mogą się od siebie nieznacznie różnić.</p>\n<p>Zabawka przeznaczona dla dzieci powyżej 3 lat.</p>\n<p>Wymiary figurki około: 7,5 x 2,7 x 4,3 cm</p>\n<p>Wszystkie zabawki posiadają certyfikat CE - Znak ten jest wyznacznikiem wysokiej jakości produktów.<br />Zabawki z tym znakiem są bezpieczne, nie zawierają szkodliwych dla zdrowia barwników i materiałów.</p></div>\n<h3>Szczegóły produktu</h3>\n<div>\n<div class=\"product-manufacturer\">\n<label class=\"label\">Marka</label>\n<span>\n<a href=\"https://monocerus.pl/brand/6-schleich\">Schleich</a>\n</span>\n</div>\n<div class=\"product-quantities\">\n<label class=\"label\">W magazynie</label>\n<span>2 Przedmioty</span>\n</div>\n<div class=\"product-out-of-stock\">\n</div>\n<div class=\"product-condition\">\n<label class=\"label\">Stan: </label>\n\n<span>Nowość</span>\n</div>\n</div>\n<h3>Bezpieczeństwo produktu</h3>\n<p></p><div class=\"x13gpsr x13gpsr-shop-1 x13gpsr--displayProductExtraContent\">\n<p class=\"x13gpsr__list\">\n<strong class=\"x13gpsr__item x13gpsr__title\">Producent</strong>\n<span class=\"x13gpsr__item\">    Schleich</span>\n<span class=\"x13gpsr__item\">St.-Martin-Str. 102</span>\n<span class=\"x13gpsr__item\">81669\n    München</span>\n<span class=\"x13gpsr__item\">Niemcy</span>\n<span class=\"x13gpsr__item\"><a href=\"mailto:info@schleich-s.com\">info@schleich-s.com</a></span>\n</p>\n<div class=\"x13gpsr__extraNote\">\n<p><img alt=\"\" height=\"50\" src=\"https://monocerus.pl/img/cms/ce-128.png\" width=\"85\" /><img alt=\"\" height=\"50\" src=\"https://monocerus.pl/img/cms/0-3-128.png\" width=\"50\" />  <img alt=\"\" height=\"50\" src=\"https://monocerus.pl/img/cms/im-green-bio-based.png\" width=\"50\" />  <img alt=\"\" height=\"50\" src=\