różnić.</p>\n<p>Zabawka przeznaczona dla dzieci powyżej 4 lat.</p>\n<p>Figurki koni mają około 8 cm wysokości (zależy od pozy, jaką przyjmują)</p>\n<p>Wymiary opakowania: 21 x 24,5 x 4,5 cm</p>\n<p>Wszystkie zabawki posiadają certyfikat CE - Znak ten jest wyznacznikiem wysokiej jakości produktów.<br />Zabawki z tym znakiem są bezpieczne, nie zawierają szkodliwych dla zdrowia barwników i materiałów.</p></div>\n<h3>Szczegóły produktu</h3>\n<div>\n<div class=\"product-manufacturer\">\n<label class=\"label\">Marka</label>\n<span>\n<a href=\"https://monocerus.pl/brand/4-breyer-stablemates\">Breyer Stablemates</a>\n</span>\n</div>\n<div class=\"product-quantities\">\n<label class=\"label\">W magazynie</label>\n<span>1 Przedmiot</span>\n</div>\n<div class=\"product-out-of-stock\">\n</div>\n<div class=\"product-condition\">\n<label class=\"label\">Stan: </label>\n\n<span>Nowość</span>\n</div>\n</div>\n<h3>Bezpieczeństwo produktu</h3>\n<p></p><div class=\"x13gpsr x13gpsr-shop-1 x13gpsr--displayProductExtraContent\">\n<p class=\"x13gpsr__list\">\n<strong class=\"x13gpsr__item x13gpsr__title\">Producent</strong>\n<span class=\"x13gpsr__item\">    Reeves International, Inc.</span>\n<span class=\"x13gpsr__item\">Industrial Road 14</span>\n<span class=\"x13gpsr__item\">NJ 07440\n    Pequannock</span>\n<span class=\"x13gpsr__item\">Stany Zjednoczone</span>\n<span class=\"x13gpsr__item\"><a href=\"mailto:info@reevesintl.com\">info@reevesintl.com</a></span>\n</p>\n<div class=\"x13gpsr__extraNote\">\n<p><img alt=\"\" height=\"50\" src=\"https://monocerus.pl/img/cms/ce-128.png\" width=\"83\" /><img alt=\"\" height=\"50\" src=\"https://monocerus.pl/img/cms/ukca.png\" width=\"50\" /><img height=\"50\" src=\"https://monocerus.pl/img/cms/0-3-128.png\" width=\"50\" alt=\"0-3-128.png\" /><img alt=\"\" height=\"50\" src=\"https://monocerus.pl/img/cms/4+.png\" width=\"50\" /></p>\n<p>wyjaśnienie oznaczeń na produkcie: <a href=\"https://monocerus.pl/content/6-oznaczenia-na-produktach\">https:/